ushButton, QSpinBox, QTabWidget, QComboBox, QDialogButtonBox, QGridLayout, # @UnusedImport @Reimport  @UnresolvedImport","                                 QGroupBox, QRadioButton, QButtonGroup, # @UnusedImport @Reimport  @UnresolvedImport","                                 QTableWidget, QMessageBox, QHeaderView, QTableWidgetItem, QSizePolicy) # @UnusedImport @Reimport  @UnresolvedImport","","","class DeviceAssignmentDlg(ArtisanResizeablDialog):","    def __init__(self, parent:QWidget, aw:'ApplicationWindow', activeTab:int = 0) -\u003e None:","        super().__init__(parent,aw)","        self.activeTab = activeTab","        self.setWindowTitle(QApplication.translate('Form Caption','Device Assignment'))","        self.setModal(True)","","        self.helpdialog = None","","        self.org_phidgetRemoteFlag = self.aw.qmc.phidgetRemoteFlag","        self.org_yoctoRemoteFlag = self.aw.qmc.yoctoRemoteFlag","        self.org_santokerSerial = self.aw.santokerSerial","        self.org_santokerBLE = self.aw.santokerBLE","        self.org_kaleidoSerial = self.aw.kaleidoSerial","","        self.org_scale1_model = self.aw.scale1_model","        self.org_scale1_name = self.aw.scale1_name","        self.org_scale1_id = self.aw.scale1_id","        self.org_container1_idx = self.aw.container1_idx","        self.org_scale2_model = self.aw.scale2_model","        self.org_scale2_name = self.aw.scale2_name","        self.org_scale2_id = self.aw.scale2_id","        self.org_container2_idx = self.aw.container2_idx","","        ################ TAB 1   WIDGETS","        #ETcurve","        self.ETcurve = QCheckBox(QApplication.translate('CheckBox', 'ET'))","        self.ETcurve.setChecked(self.aw.qmc.ETcurve)","        #BTcurve","        self.BTcurve = QCheckBox(QApplication.translate('CheckBox', 'BT'))","        self.BTcurve.setChecked(self.aw.qmc.BTcurve)","        #ETlcd","        self.ETlcd = QCheckBox(QApplication.translate('CheckBox', 'ET'))","        self.ETlcd.setChecked(self.aw.qmc.ETlcd)","        #BTlcd","        self.BTlcd = QCheckBox(QApplication.translate('CheckBox', 'BT'))","        self.BTlcd.setChecked(self.aw.qmc.BTlcd)","        #swaplcd","        self.swaplcds = QCheckBox(QApplication.translate('CheckBox', 'Swap'))","        self.swaplcds.setChecked(self.aw.qmc.swaplcds)","        self.curveHBox = QHBoxLayout()","        self.curveHBox.setContentsMargins(10,5,10,5)","        self.curveHBox.setSpacing(5)","        self.curveHBox.addWidget(self.ETcurve)","        self.curveHBox.addSpacing(10)","        self.curveHBox.addWidget(self.BTcurve)","        self.curveHBox.addStretch()","        self.curves = QGroupBox(QApplication.translate('GroupBox','Curves'))","        self.curves.setLayout(self.curveHBox)","        self.lcdHBox = QHBoxLayout()","        self.lcdHBox.setContentsMargins(0,5,0,5)","        self.lcdHBox.setSpacing(5)","        self.lcdHBox.addWidget(self.ETlcd)","        self.lcdHBox.addSpacing(10)","        self.lcdHBox.addWidget(self.BTlcd)","        self.lcdHBox.addSpacing(15)","        self.lcdHBox.addWidget(self.swaplcds)","        self.lcds = QGroupBox(QApplication.translate('GroupBox','LCDs'))","        self.lcds.setLayout(self.lcdHBox)","","        self.deviceLoggingFlag = QCheckBox(QApplication.translate('Label', 'Logging'))","        self.deviceLoggingFlag.setChecked(self.aw.qmc.device_logging)","","        self.controlButtonFlag = QCheckBox(QApplication.translate('Label', 'Control'))","        self.controlButtonFlag.setChecked(self.aw.qmc.Controlbuttonflag)","        self.controlButtonFlag.stateChanged.connect(self.showControlbuttonToggle)","","        self.nonpidButton = QRadioButton(QApplication.translate('Radio Button','Meter'))","        self.pidButton = QRadioButton(QApplication.translate('Radio Button','PID'))","        self.arduinoButton = QRadioButton(QApplication.translate('Radio Button','TC4'))","        self.programButton = QRadioButton(QApplication.translate('Radio Button','Prog'))","        #As a main device, don't show the devices that start with a \"+\"","        # devices with a first letter \"+\" are extra devices an depend on another device","        # each device provides 2 curves","        #don't show devices with a \"-\". Devices with a - at front are either a pid, arduino, or an external program","        dev = self.aw.qmc.devices[:]             #deep copy","        limit = len(dev)","        for _ in range(limit):","            for i, _ in enumerate(dev):","                if dev[i][0] in {'+', '-'}:","                    dev.pop(i)              #note: pop() makes the list smaller that's why there are 2 FOR statements","                    break","        self.sorted_devices = sorted(dev)","        self.devicetypeComboBox = MyContentLimitedQComboBox()","","##        self.devicetypeComboBox.setSizeAdjustPolicy(QComboBox.SizeAdjustPolicy.AdjustToContents)","##        self.devicetypeComboBox.view().setTextElideMode(Qt.TextElideMode.ElideNone)","#        # HACK: only needed for the macintosh UI on Qt 5.12 onwords; without long items get cut in the popup","#        #  note the -7 as the width of the popup is too large if given the correct maximum characters","##        self.devicetypeComboBox.setMinimumContentsLength(max(22,len(max(dev, key=len)) - 7)) # expects # characters, but is to wide","# the following \"hack\" helped on PyQt5, but seems not to be needed on PyQt6 any longer","#        self.devicetypeComboBox.setSizePolicy(QSizePolicy.Policy.Expanding,self.devicetypeComboBox.sizePolicy().verticalPolicy())","","        self.devicetypeComboBox.addItems(self.sorted_devices)","        self.programedit = QLineEdit(self.aw.ser.externalprogram)","        self.outprogramedit = QLineEdit(self.aw.ser.externaloutprogram)","        self.outprogramFlag = QCheckBox(QApplication.translate('CheckBox', 'Output'))","        self.outprogramFlag.setChecked(self.aw.ser.externaloutprogramFlag)","        self.outprogramFlag.stateChanged.connect(self.changeOutprogramFlag) 